What=E2=80=99s Your Dribbble Fantasy?
-----------------------------

Is it listening to Gleb Kuznetsov ( https://dribbble.com/glebich )  from Fa=
ntasy ( https://dribbble.com/Fantasy ) share his design
secrets on an episode of Overtime? You=E2=80=99re in luck. In our 7th
episode=20
( https://dribbble.com/stories/2016/12/01/overtime-gleb-kuznetsov )
, you can listen to Dan ( https://dribbble.com/simplebits ) and
Gleb chat about the design and development scene in Russia, how
Gleb got his job at Fantasy, why it pays to work on side projects
just for fun, and more.

We=E2=80=99re also excited to hear Gleb live and in person at the NYC
Fantasy + Dribbble Meetup=20
( https://dribbble.com/shots/3110590-Dribbble-Fantasy-NYC-2016-Event )
 on Thursday. Unfortunately, the event is full, but if you=E2=80=99re on
the list, we=E2=80=99ll see you there!

With this episode, we=E2=80=99re celebrating the one year anniversary of
Overtime! If you=E2=80=99ve missed any episodes, catch up via our archive
( https://dribbble.com/stories/categories/overtime ) and if
you=E2=80=99ve enjoyed Overtime this year, we=E2=80=99d love to have you ra=
te us
and leave a review on iTunes=20
( https://itunes.apple.com/us/podcast/overtime/id1068288639 ).

